INSERT INTO `ejercicios` (`id`, `nombre`, `descripcion`, `equipamiento`) VALUES
(1, 'Levantamiento de pesas', 'Ejercicio de fuerza que consiste en levantar y bajar pesos utilizando diferentes técnicas y movimientos específicos para trabajar grupos musculares específicos.', 'Barra olímpica y discos de pesas.'),
(2, 'Pesas con ambas manos', 'Ejercicio de fuerza que consiste en levantar y bajar pesas utilizando ambas manos simultáneamente. Se enfoca en trabajar los músculos superiores del cuerpo, como los bíceps, tríceps y hombros.', 'Mancuernas o pesas de mano de igual peso para ambas manos.'),
(3, 'Prensa de piernas con peso', 'Ejercicio de fortalecimiento de piernas que consiste en abrir y cerrar las piernas mientras se aplica resistencia con peso. Se trabaja principalmente los músculos de los muslos y glúteos.', ' Máquina de prensa de piernas con discos de pesas ajustables.'),
(4, 'Remo inclinado con mancuernas', 'Ejercicio de fortalecimiento de la espalda que consiste en inclinarse sobre una mesa o banco mientras se levantan las mancuernas hacia el pecho, simulando el movimiento de remar. Se trabajan principalmente los músculos de la espalda, los hombros y los brazos.', 'Mancuernas de peso adecuado y una mesa o banco inclinado.'),
(9, 'Levantamiento de pesas al pecho', 'Esta es una actividad deonde se levanta una pesa de aproximadamente 90kg hasta el pecho', 'barra y discos'),
(10, 'Curl de bíceps y extensión de tríceps', 'El ejercicio de Curl de bíceps y extensión de tríceps es una combinación de dos movimientos individuales que se centran en trabajar tanto los músculos del bíceps como los del tríceps en los brazos.', 'Barra con pesas o mancuernas.'),
(11, 'Cuadrisep', 'Se trabajara la parte bajad el cuadrisep', 'Mancuernas'),
(20, 'Full Bisep', 'entrenamiento de fuerza diseñado para enfocarse en el desarrollo y fortalecimiento de los músculos del bíceps, que se encuentran en la parte frontal del brazo. Este ejercicio es ideal para aquellos que desean obtener unos brazos más definidos y tonificados. ', 'Barra de pesas: y Discos de peso'),
(21, 'dwdawd', 'dwadad', 'dawdada'),
(22, 'dwdawd', 'dwadad', 'dawdada'),
(23, 'Ejercicio Prueba 2', 'prueba', 'Prueba'),
(24, 'dwdawd', 'dwadad', 'dawdada');

